I am half way through my art residency with @venus_de_tierra and am tired, scraped up, and already having to think ahead to book June. 
Reno: June 2-7
SF: 13-17

In this short and jam packed 15 days, I have bonded with amazing women, explored epic locations, experienced the most unforgettable Sunrises and Sunsets in the same day, and to top it all off, I have glorious art to show for it. 

Honestly, I don’t want it to end, to have to think about what’s next, or how to keep it going. I just want to sit here and be thankful for everything I have, all the people in my life making these moments possible, and drink coffee and create with this group of women. I’ll figure out later. 💚 
Huge shout out to this May’s Collective: 
